import fg from "fast-glob"
import Gallery from "./Gallery"

export default function Home({ images }) {
  return (
    <Gallery images={images}/>
  );
}

export async function getStaticProps() {
  const images = await fg([
    `public/gallery/inspo/*`,
  ])

  return {
    props: {
      images
    },
  };
}
